BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "admin_users" (
	"id"	INTEGER,
	"firstname"	TEXT NOT NULL,
	"surname"	TEXT NOT NULL,
	"email"	TEXT NOT NULL UNIQUE,
	"username"	TEXT NOT NULL UNIQUE,
	"password"	TEXT NOT NULL,
	"status"	TEXT NOT NULL DEFAULT 'Pending',
	"role"	TEXT NOT NULL DEFAULT 'User',
	"created_at"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "connected_accounts" (
	"id"	INTEGER,
	"user_id"	INTEGER NOT NULL,
	"platform"	TEXT NOT NULL,
	"url"	TEXT NOT NULL,
	"linkedAt"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "consumables" (
	"consumable_id"	TEXT UNIQUE,
	"consumable_location"	TEXT NOT NULL DEFAULT 'Enter Post',
	"consumable_name"	TEXT NOT NULL,
	"category"	TEXT NOT NULL DEFAULT 'Consumable',
	"unit"	TEXT NOT NULL,
	"reorder_level"	INTEGER NOT NULL,
	"expiry_date"	TEXT NOT NULL,
	"manufacturer"	TEXT,
	"description"	TEXT,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("consumable_id")
);
CREATE TABLE IF NOT EXISTS "contact_messages" (
	"id"	INTEGER,
	"name"	TEXT NOT NULL,
	"email"	TEXT NOT NULL,
	"message"	TEXT NOT NULL,
	"submitted_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "daily_checklist_data" (
	"id"	INTEGER,
	"post_location"	INTEGER DEFAULT 'ODD',
	"item_id"	INTEGER,
	"item_name"	TEXT,
	"log_date"	DATE NOT NULL DEFAULT (DATE('now')),
	"stock_start"	INTEGER DEFAULT 0,
	"stock_used"	INTEGER DEFAULT 0,
	"stock_added"	INTEGER DEFAULT 0,
	"stock_end"	INTEGER NOT NULL,
	"remarks"	TEXT,
	"logged_by"	TEXT NOT NULL DEFAULT 'System',
	"user_id"	TEXT,
	"logged_action"	TEXT NOT NULL DEFAULT 'Daily Update',
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "equipment" (
	"id"	INTEGER,
	"equipment_id"	TEXT UNIQUE,
	"equipment_location"	TEXT NOT NULL DEFAULT 'Enter Post',
	"equipment_name"	TEXT NOT NULL,
	"category"	TEXT NOT NULL DEFAULT 'Equipment',
	"equipment_status"	TEXT NOT NULL DEFAULT 'Functional',
	"unit"	TEXT NOT NULL,
	"reorder_level"	INTEGER NOT NULL,
	"service_date"	TEXT NOT NULL,
	"manufacturer"	TEXT,
	"description"	TEXT,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "fap_report_history" (
	"id"	INTEGER,
	"report_id"	TEXT NOT NULL,
	"post_location"	TEXT NOT NULL,
	"shift_type"	TEXT NOT NULL,
	"report_date"	DATE NOT NULL,
	"operation"	TEXT NOT NULL,
	"old_summary"	TEXT,
	"old_details"	TEXT,
	"submitted_by"	TEXT NOT NULL,
	"created_at"	TIMESTAMP TEXT NOT NULL,
	"modified_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"modified_by"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("report_id") REFERENCES "fap_reports"("report_id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "fap_reports" (
	"id"	INTEGER,
	"report_id"	TEXT NOT NULL UNIQUE,
	"post_location"	TEXT NOT NULL,
	"shift_type"	TEXT NOT NULL,
	"report_date"	DATE NOT NULL,
	"summary"	TEXT NOT NULL,
	"details"	TEXT NOT NULL,
	"submitted_by"	TEXT NOT NULL,
	"created_at"	TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "incident_book" (
	"id"	INTEGER,
	"post_location"	TEXT,
	"entry_id"	TEXT NOT NULL UNIQUE,
	"incident_date"	TEXT,
	"incident_time"	TEXT,
	"company"	TEXT,
	"badge"	TEXT,
	"name"	TEXT,
	"incident_type"	TEXT,
	"incident_location"	TEXT,
	"incident_details"	TEXT,
	"first_aid"	TEXT,
	"detained"	INTEGER NOT NULL DEFAULT 'No',
	"treatment_given"	TEXT,
	"disposition"	TEXT,
	"disposition_time"	TEXT,
	"reporting"	TEXT,
	"entry_by"	INTEGER,
	"created_at"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("entry_by") REFERENCES "users"("user_id")
);
CREATE TABLE IF NOT EXISTS "incident_book_history" (
	"history_id"	INTEGER,
	"id"	INTEGER,
	"post_location"	TEXT,
	"entry_id"	TEXT NOT NULL,
	"incident_date"	TEXT,
	"incident_time"	TEXT,
	"company"	TEXT,
	"badge"	TEXT,
	"name"	TEXT,
	"incident_type"	TEXT,
	"incident_location"	TEXT,
	"incident_details"	TEXT,
	"first_aid"	TEXT,
	"detained"	INTEGER NOT NULL DEFAULT 'No',
	"treatment_given"	TEXT,
	"disposition"	TEXT,
	"disposition_time"	TEXT,
	"reporting"	TEXT,
	"entry_by"	TEXT,
	"created_at"	TEXT NOT NULL,
	"modified_at"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	"deleted_on"	DATETIME,
	PRIMARY KEY("history_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "inventory_audit_trail" (
	"id"	INTEGER,
	"post_location"	TEXT,
	"item_id"	INTEGER NOT NULL,
	"action"	TEXT NOT NULL CHECK("action" IN ('ADD', 'EDIT', 'DELETE', 'RESTOCK')),
	"changes"	TEXT NOT NULL,
	"performed_by"	INTEGER NOT NULL,
	"performed_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "inventory_categories" (
	"id"	INTEGER,
	"name"	TEXT UNIQUE,
	"description"	TEXT,
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "inventory_items" (
	"post_location"	TEXT NOT NULL DEFAULT 'Update Post',
	"id"	INTEGER,
	"item_name"	TEXT NOT NULL,
	"category_id"	INTEGER NOT NULL,
	"unit"	TEXT NOT NULL,
	"reorder_level"	INTEGER,
	"expiry_date"	TEXT,
	"equipment_status"	TEXT DEFAULT 'Functional',
	"service_date"	TEXT,
	"stock"	INTEGER DEFAULT 0,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "inventory_monthly_summaries" (
	"id"	INTEGER,
	"item_id"	INTEGER NOT NULL,
	"month_year"	TEXT NOT NULL,
	"stock_start"	INTEGER NOT NULL,
	"stock_used"	INTEGER DEFAULT 0,
	"stock_added"	INTEGER DEFAULT 0,
	"stock_end"	INTEGER NOT NULL,
	"remarks"	TEXT,
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"post_location"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("id") REFERENCES "inventory_items"("id")
);
CREATE TABLE IF NOT EXISTS "isoup_incident_book" (
	"id"	INTEGER,
	"post_location"	TEXT,
	"entry_id"	TEXT NOT NULL UNIQUE,
	"incident_date"	TEXT,
	"incident_time"	TEXT,
	"company"	TEXT,
	"badge"	TEXT,
	"name"	TEXT,
	"incident_type"	TEXT,
	"incident_location"	TEXT,
	"incident_details"	TEXT,
