CREATE TABLE IF NOT EXISTS "items_register" (
	"id"	INTEGER NOT NULL,
	"post_location"	TEXT NOT NULL,
	"item_id"	TEXT NOT NULL UNIQUE,
	"category"	INTEGER NOT NULL,
	"name"	TEXT NOT NULL,
	"image_url"	TEXT NOT NULL DEFAULT '/images/default-item.png',
	"description"	TEXT NOT NULL,
	"initial_stock"	INTEGER DEFAULT 0,
	"used_stock"	INTEGER DEFAULT 0,
	"added_stock"	INTEGER DEFAULT 0,
	"available_stock"	INTEGER DEFAULT 0,
	"reorder_level"	INTEGER DEFAULT 0,
	"manufacturer"	TEXT DEFAULT 'Unknown Manufacturer',
	"expiry_date"	DATE,
	"device_status"	TEXT DEFAULT 'Functional',
	"service_date"	DATE,
	"created_at"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
