CREATE TABLE IF NOT EXISTS "items_register_history" (
	"id"	INTEGER NOT NULL,
	"post_location"	TEXT NOT NULL,
	"item_id"	TEXT NOT NULL UNIQUE,
	"category"	INTEGER NOT NULL,
	"name"	TEXT NOT NULL,
	"image_url"	TEXT NOT NULL DEFAULT '/images/default-item.png',
	"description"	TEXT NOT NULL,
	"initial_stock"	INTEGER DEFAULT 0,
	"reorder_level"	INTEGER DEFAULT 0,
	"available_stock"	INTEGER DEFAULT 0,
	"manufacturer"	TEXT DEFAULT 'Unknown Manufacturer',
	"expiry_date"	DATE,
	"device_status"	TEXT DEFAULT 'Functional',
	"service_date"	DATE,
	"created_at"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	"deleted_on"	DATETIME,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "medications" (
	"medication_id"	TEXT UNIQUE,
	"medication_location"	TEXT NOT NULL DEFAULT 'Enter Post',
	"medication_name"	TEXT NOT NULL UNIQUE,
	"category"	TEXT NOT NULL DEFAULT 'Medication',
	"dosage_form"	TEXT NOT NULL,
	"unit"	TEXT NOT NULL,
	"reorder_level"	INTEGER NOT NULL,
	"expiry_date"	TEXT NOT NULL,
	"manufacturer"	TEXT,
	"description"	TEXT,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("medication_id")
);
CREATE TABLE IF NOT EXISTS "notifications" (
	"id"	INTEGER,
	"user_id"	INTEGER NOT NULL,
	"message"	TEXT NOT NULL,
	"status"	TEXT DEFAULT 'Unread' CHECK("status" IN ('Unread', 'Read')),
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"post_location"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "nurses" (
	"id"	INTEGER,
	"staff_id"	VARCHAR(50) NOT NULL UNIQUE,
	"name"	VARCHAR(255) NOT NULL,
	"gender"	VARCHAR(10) NOT NULL,
	"grade"	VARCHAR(50) NOT NULL,
	"emp_date"	DATE NOT NULL,
	"rank"	VARCHAR(100) NOT NULL,
	"department"	VARCHAR(100) NOT NULL DEFAULT 'Nursing Services',
	"picture"	VARCHAR(255) DEFAULT '/images/default-profile.png',
	"email"	VARCHAR(255) NOT NULL,
	"phone"	VARCHAR(20) NOT NULL,
	"service_status"	VARCHAR(20) NOT NULL DEFAULT 'active',
	"accommodation_status"	VARCHAR(20) NOT NULL DEFAULT 'non-residential',
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "post_locations" (
	"name"	TEXT NOT NULL UNIQUE,
	"in_charge"	TEXT DEFAULT 'Numan Usman',
	"status"	TEXT NOT NULL DEFAULT 'Active' CHECK("status" IN ('Active', 'Inactive')),
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("name")
);
CREATE TABLE IF NOT EXISTS "recent_activities" (
	"id"	INTEGER,
	"user_id"	INTEGER NOT NULL,
	"post_location"	TEXT DEFAULT 'N/A',
	"activity"	TEXT,
	"timestamp"	TEXT DEFAULT (datetime('now', 'localtime')),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "replenishment_requests" (
	"id"	INTEGER,
	"facility_name"	TEXT NOT NULL,
	"item_id"	INTEGER NOT NULL,
	"quantity_requested"	INTEGER NOT NULL,
	"status"	TEXT DEFAULT 'Pending' CHECK("status" IN ('Pending', 'Approved', 'Rejected')),
	"requested_by"	TEXT NOT NULL,
	"approved_by"	TEXT,
	"created_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("approved_by") REFERENCES "users"("user_id") ON DELETE SET NULL,
	FOREIGN KEY("facility_name") REFERENCES "post_locations"("name") ON DELETE CASCADE,
	FOREIGN KEY("item_id") REFERENCES "inventory_items"("id") ON DELETE CASCADE,
	FOREIGN KEY("requested_by") REFERENCES "users"("user_id") ON DELETE SET NULL
);
