CREATE TRIGGER update_available_stock
AFTER UPDATE OF initial_stock, added_stock, used_stock ON items_register
BEGIN
    UPDATE items_register
    SET available_stock = (initial_stock + added_stock - used_stock)
    WHERE id = NEW.id;
END;
